import ButtonBox from './components/ButtonBox/ButtonBox';
import Screen from './components/Screen/Screen';
import Wrapper from './components/Wrapper/Wrapper';

const btnValues = [
  ["C", "+-", "%", "/"],
  [7, 8, 9, "*"],
  [4, 5, 6, "-"],
  [1, 2, 3, "+"],
  [0, ".", "="]
]

function App() {
  return (
    <Wrapper>
      <Screen value="00" />
      <ButtonBox>
        <Button
          className=""
          value="0"
          onClick={() => {
            console.log("Button Clicked")
          }}
        />
      </ButtonBox>
    </Wrapper>
  )
}

export default App;
